import React from 'react';
import { 
    Nav , 
    NavBarContainer,
    NavBarLogo,
    MobileIcon,
    NavMenu
} from './NavbarElements';

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavBarContainer>
                    <NavBarLogo to='/'>funko!</NavBarLogo>
                    <MobileIcon>
                        <FaBars/>
                    </MobileIcon>
                    <NavMenu>
                        <navItem>
                            <navLinks>About</navLinks>
                        </navItem>
                    </NavMenu>
                </NavBarContainer>
            </Nav>
        </>
    )
}

export default Navbar;
